  input: '"TEXT","F3XA","","We are amending this report in response to your letter
    dated September 19, 2007. The following is our procedure for requesting missing
    occupation and employer information.  In our original solicitation, we request
    the contributor''s information clearly and conspicuously, stating that federal
    law requires us to use our best efforts to obtain their address, occupation and
    employer if they give an aggregate of $200 to the committee.     If for some reason
    we do not receive this information, we send a follow-up request within 30 days
    again stating that we are required to use our best efforts to obtain their address,
    occupation and employer.  Our follow-up request contains no new solicitations
    and includes a pre-addressed return envelope.    If we do receive contributor
    information after the contribution has been reported, we will either file with
    our next report, an amended memo schedule A listing the additional information
    or file on or before our next regularly scheduled reporting date amendments to
    the original report.    We have clarified the occupation and employer for Stan
    Schlueter. Our rent payment includes utilities, so we have amended our description
    to include that information.  We have also moved our disbursement to the Treasure
    State PAC to line 23. We have also clarified that the contribution on June 30,
    2007 was from Public Service Enterprise PAC and not Public Service Electric and
    Gas Company PAC.",""'
